206. Reverse Linked List
← Back to problem
Approach 1: Iterative
Assume that we have linked list 1 → 2 → 3 → Ø, we would like to change it to Ø ← 1 ← 2 ← 3.
While you are traversing the list, change the current node's next pointer to point to its previous element. Since a node does not have reference to its previous node, you must store its previous element beforehand. You also need another pointer to store the next node before changing the reference. Do not forget to return the new head reference at the end!
Implementation
public ListNode reverseList(ListNode head) {
    ListNode prev = null;
    ListNode curr = head;
    while (curr != null) {
        ListNode nextTemp = curr.next;
        curr.next = prev;
        prev = curr;
        curr = nextTemp;
    }
    return prev;
}

Complexity Analysis

Time complexity : O(n)\mathcal{O}(n)O(n). Assume that nn is the list's length, the time complexity is O(n)\mathcal{O}(n)O(n).
Space complexity : O(1)\mathcal{O}(1)O(1).

206. Reverse Linked List
← Back to problem
Approach 2: Recursive
The recursive version is slightly trickier and the key is to work backwards. Assume that the rest of the list had already been reversed, now how do I reverse the front part? Let's assume the list is: n1 → … → nk-1 → nk → nk+1 → … → nm → Ø
Assume from node nk+1 to nm had been reversed and you are at node nk.
n1 → … → nk-1 → nk → nk+1 ← … ← nm
We want nk+1’s next node to point to nk.
So,
nk.next.next = nk;
Be very careful that n1's next must point to Ø. If you forget about this, your linked list has a cycle in it. This bug could be caught if you test your code with a linked list of size 2.
Implementation
public ListNode reverseList(ListNode head) {
    if (head == null || head.next == null) return head;
    ListNode p = reverseList(head.next);
    head.next.next = head;
    head.next = null;
    return p;
}

Complexity Analysis

Time complexity : O(n)\mathcal{O}(n)O(n). Assume that nnn is the list's length, the time complexity is O(n)\mathcal{O}(n)O(n).
Space complexity : O(n)\mathcal{O}(n)O(n). The extra space comes from implicit stack space due to recursion. The recursion could go up to nnn levels deep.

